import { View, StyleSheet } from "react-native";

const dotCSSInfo = {
  width: 10,
  height: 10,
  unit: "px",
};

const inputTypePasswordCSSInfo = {
  width: 200,
  height: 100,
  unit: "px",
};

const AuroraPasswordInputComponent = () => {
  const attachShadow = (host: Element) => {
    host.attachShadow({ mode: "open" });
  };
  return <View style={styles.membrane}></View>;
};

const styles = StyleSheet.create({
  membrane: {
    height: 100,
    width: 200,
    borderWidth: 1,
    borderColor: "#111",
    borderStyle: "solid",
  },
});

export default AuroraPasswordInputComponent;
